import React from 'react';
import logo from './logo.svg';
import './App.css';

const App =()=> {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h3>
          This is a PWA App
        </h3>
      </header>
    </div>
  );
}

export default App;
